[General]
ConfigVersion=2

[Browser]
CustomProxyLocation=
Enabled=true
MatchUrlScheme=false

[GUI]
AdvancedSettings=true
ApplicationTheme=dark
CompactMode=true
HidePasswords=true
MinimizeOnClose=true
MinimizeToTray=true
ShowTrayIcon=true
TrayIconAppearance=colorful

[KeeShare]
Active="<?xml version=\"1.0\"?><KeeShare><Active/></KeeShare>\n"
Own="<?xml version=\"1.0\"?><KeeShare><PrivateKey></PrivateKey><PublicKey><Signer>ribu</Signer><Key></Key></PublicKey></KeeShare>\n"
QuietSuccess=true

[PasswordGenerator]
AdditionalChars=
AdvancedMode=true
EASCII=true
ExcludedChars=
Length=64
Logograms=true
Punctuation=true
SpecialChars=false
Type=1
UpperCase=true
WordCount=4
WordList=catala-ascii.wordlist

[Security]
EnableCopyOnDoubleClick=true
IconDownloadFallback=true
LockDatabaseScreenLock=false
